    }

    function setSwapAndLiquifyEnabled(bool _enabled) public onlyOwner {
        swapAndLiquifyEnabled = _enabled;
    }

    function swapManual() public {
        swapping = true;
        if(amountAddr1Fee > 0) swapAndSendAddr1Fee(amountAddr1Fee);
        if(amountAddr2Fee > 0) swapAndSendAddr2Fee(amountAddr2Fee);
        if(amountAddr3Fee > 0) swapAndSendAddr3Fee(amountAddr3Fee);
        if(amountAddr4Fee > 0) swapAndSendAddr4Fee(amountAddr4Fee);
        if(amountAddr5Fee > 0) swapAndSendAddr5Fee(amountAddr5Fee);
        if(amountAddr6Fee > 0) swapAndSendAddr6Fee(amountAddr6Fee);
        if(amountLPFee > 0) swapAndSendLPFee(msg.sender);
        swapping = false;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if(automatedMarketMakerPairs[from] &&
        canSwap &&
        !swapping &&
        from != owner() &&
        to != owner() &&
        swapAndLiquifyEnabled
        ) {
            swapping = true;
            if(amountAddr1Fee > 0) swapAndSendAddr1Fee(amountAddr1Fee);
            if(amountAddr2Fee > 0) swapAndSendAddr2Fee(amountAddr2Fee);
            if(amountAddr3Fee > 0) swapAndSendAddr3Fee(amountAddr3Fee);
            if(amountAddr4Fee > 0) swapAndSendAddr4Fee(amountAddr4Fee);
            if(amountAddr5Fee > 0) swapAndSendAddr5Fee(amountAddr5Fee);
            if(amountAddr6Fee > 0) swapAndSendAddr6Fee(amountAddr6Fee);
            if(amountLPFee > 0) swapAndSendLPFee(to);
            swapping = false;
        }

        bool takeFee = !swapping;
        // if any account belongs to _isExcludedFromFee account then remove the fee
        if(isExcludedFromFees[from] || isExcludedFromFees[to]) {
            takeFee = false;
        }

        if(automatedMarketMakerPairs[to]) {
            require(!mapRobot[from], "bot");
        }

        if(takeFee) {
            uint256 fees;
            if(automatedMarketMakerPairs[to]){
                uint256 dFee = amount.mul(sellDeadFee).div(100);
                if(dFee > 0) super._burn(from, dFee);
                fees = dFee;
                if(mapBuyBlock[from] > 0 && block.number.sub(mapBuyBlock[from]) <= num) {
                    mapRobot[from] = true;
                }
            }
            if(automatedMarketMakerPairs[from]){
                require(limitation,"Transaction not opened");
                uint256 fee1 = amount.mul(addr1Fee).div(10000);
                amountAddr1Fee += fee1;
                uint256 fee2 = amount.mul(addr2Fee).div(10000);
                amountAddr2Fee += fee2;
                uint256 fee3 = amount.mul(addr3Fee).div(10000);
                amountAddr3Fee += fee3;
                uint256 fee4 = amount.mul(addr4Fee).div(10000);
                amountAddr4Fee += fee4;
                uint256 fee5 = amount.mul(addr5Fee).div(10000);
                amountAddr5Fee += fee5;
                uint256 fee6 = amount.mul(addr6Fee).div(10000);
                amountAddr6Fee += fee6;
                uint256 fee = amount.mul(lpFee).div(10000);
                amountLPFee += fee;
                fees = fee1.add(fee2).add(fee3).add(fee4);
                fees = fees.add(fee5).add(fee6).add(fee);
                super._transfer(from, address(this), fees);

                mapBuyBlock[to] = block.number;
            }
            amount = amount.sub(fees);

        }
        super._transfer(from, to, amount);
    }

