        uint256 newBalance = (IERC20(usdt).balanceOf(address(this))).sub(initialCAKEBalance);
        IERC20(usdt).transfer(addr6, newBalance);
        amountAddr6Fee = amountAddr6Fee.sub(_amount);
    }

